import logo from './logo.svg';
import './App.css';
import Greet from './components/Greetings';
import Func from './components/Welcome';
import Hello from './components/Hello';
function App() {
  return (
    <div className="App">
        <Greet/>
        <Func />
        <Hello name='Matt'></Hello>
        <Hello name='Frank'></Hello>
        <Hello name='Karen'></Hello>
    </div>
  );
}

export default App;
